  `remittanceid` varchar(50) NOT NULL,
  `stubno` varchar(20) NOT NULL,
  `aftype` varchar(10) default NULL,
  PRIMARY KEY  (`objid`),
  KEY `FK_remittance` (`remittanceid`),
  KEY `FK_afcontrol` (`afcontrolid`),
  KEY `FK_af` (`afid`),
