  CONSTRAINT `FK_afcontrol` FOREIGN KEY (`afcontrolid`) REFERENCES `afcontrol` (`objid`),
  CONSTRAINT `FK_remittance` FOREIGN KEY (`remittanceid`) REFERENCES `remittance` (`objid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

