insert  into `rule`(`objid`,`schemaname`,`schemaversion`,`docstate`,`rulename`,`description`,`packagename`,`author`,`salience`,`agendagroupid`,`agendagroup`,`ruleset`,`effectivefrom`,`effectiveto`,`ruletext`,`conditions`,`actions`,`extended`,`opener`) values ('R-3d003eed:13604552478:-7fd2','rule','1.0','DEPLOYED','PENALTY_2009_TO_CURRENT_YEAR','PENALTY 2009 TO CURRENT YEAR','etracs2.rpt.billing.rules.PENALTY_2009_TO_CURRENT_YEAR','MAGBANUA, NONITA',50000,'PENALTY','PENALTY','rptbilling',NULL,NULL,'package etracs2.rpt.billing.rules;\n\nimport etracs2.rpt.billing.facts.*\nimport java.util.*\n\nglobal com.rameses.rules.common.RuleAction actionList\n\nrule \"PENALTY_2009_TO_CURRENT_YEAR\"\nagenda-group \"PENALTY\"\nno-loop\nsalience 50000\n\nwhen\n$LEDGER : RPTLedgerFact( $ledgerid:ledgerid )\nCurrentYearFact(CY:year)\nRPTLedgerFact(year >= 2009, year < CY, NMON:numberofmonthsfromqtr, BASIC:basic, SEF:sef, ledgerid == $ledgerid)\nthen\n$LEDGER.setBasicintacctid(\"IA41a0f494:13564c96212:-7f30\");\n$LEDGER.setExpr(\"IIF( NMON * 0.02 > 0.72, BASIC * 0.72, BASIC * NMON * 0.02)\");\n$LEDGER.setRevtype(\"previous\");\n$LEDGER.setVarlist( new HashMap() );\n$LEDGER.getVarlist().put(\"CY\", CY);\n$LEDGER.getVarlist().put(\"NMON\", NMON);\n$LEDGER.getVarlist().put(\"BASIC\", BASIC);\n$LEDGER.getVarlist().put(\"SEF\", SEF);\nactionList.setContext( drools );\nactionList.execute(\"calcBasicInt\", $LEDGER);\n$LEDGER.setSefintacctid(\"IA41a0f494:13564c96212:-7f59\");\n$LEDGER.setExpr(\"IIF( NMON * 0.02 > 0.72, BASIC * 0.72, BASIC * NMON * 0.02 )\");\n$LEDGER.setRevtype(\"previous\");\n$LEDGER.setVarlist( new HashMap() );\n$LEDGER.getVarlist().put(\"CY\", CY);\n$LEDGER.getVarlist().put(\"NMON\", NMON);\n$LEDGER.getVarlist().put(\"BASIC\", BASIC);\n$LEDGER.getVarlist().put(\"SEF\", SEF);\nactionList.setContext( drools );\nactionList.execute(\"calcSefInt\", $LEDGER);\nend','[[fact:[name:\"CurrentYearFact\",caption:\"Current Year\",ruleset:\"rptbilling\",packagename:\"etracs2.rpt.billing.