id == $appid )\n\nthen\nMap m = new HashMap();\nm.put(\"rulename\", \"TEST\");\nm.put(\"appid\", $appid);\nm.put(\"lobid\", $lobid);\nm.put(\"lobname\", $lobname);\nm.put(\"expr\", \"200.00\");\nm.put(\"acctid\", \"IA3b52a903:1362da0716c:-7ff6\");\nm.put(\"accttitle\", \"BUSINESS TAX ON RETAILER\");\nm.put(\"applytype\", \"PERLINE\" );\nactionList.setContext( drools );\nactionList.execute(\"addTaxFee\", m );\nend\n\n','[[objid:\"RC-5d720f2a:136a51f3d23:-7ffc\",opener:\"bp-rule-mgmt:bpassessment_condition_lobapptype\",displaytext:\"Line of Business Assessment Type is any of the following:  RENEW\",types:[\"RENEW\"],conditiontype:\"lobapptype\"]]','[[objid:\"RA-5d720f2a:136a51f3d23:-7ffb\",opener:\"bp-rule-mgmt:bpassessment_action_taxfeecharge\",displaytext:\"Compute BUSINESS TAX ON RETAILER using formula 200.00. Apply per Line of Business\",applytype:[name:\"PERLINE\",caption:\"Apply per Line of Business\"],computationmode:\"FORMULA\",expr:\"200.00\",ranges:[],acctid:\"IA3b52a903:1362da0716c:-7ff6\",accttitle:\"BUSINESS TAX ON RETAILER\",actiontype:\"taxfeecharge\"]]','[version:\"1.0\"]',NULL);

